import Meta from '../Meta/Meta';
import Sidebar from '../Sidebar/Sidebar';
import MainContent from '../MainContent/MainContent';
import UserAvatar from '../UserAvatar/UserAvatar';
import ProfileForm from '../ProfileForm/ProfileForm';
import ProfileBox from '../ProfileBox/ProfileBox';

const Dashboard = ({pageTitle, route, logout})=> {
    let componentToRender;
    switch (route) {
        case "main":
            return componentToRender = <p>I'm the main</p>;

        case "profile":
            return componentToRender = (
                <div>
                    <ProfileBox/>
                    <ProfileForm/>
                </div>
            );

        case "settings":
            return componentToRender = <h1>Settings page</h1>

        case "payment":
            return  componentToRender = <h1>Payment page</h1>;

        default:
            return componentToRender = <p>Page not found</p>
    }

    return (
        <div>
            <Meta pageTitle={pageTitle}/>
            <div className="app">
                <Sidebar route={route}/>
                <MainContent>
                    {componentToRender}
                </MainContent>
                <style jsx>
                    {`
                        .app{
                            width: 100%;
                            height: 100vh;
                            display: flex;
                        }

                        .app > *{
                            height: inherit;
                        }
                    `}
                </style>
            </div>
        </div>
    )
};

export default Dashboard;
